function steadyGene(gene) {

    const eachTargetNum = gene.length / 4
    const geneArr = gene.split('')
    const eachCurrentNum = {
        A :geneArr.filter(e => e === 'A').length,
        G :geneArr.filter(e => e === 'G').length,
        C :geneArr.filter(e => e === 'C').length,
        T :geneArr.filter(e => e === 'T').length,
    }
    const eachRequiredNum = {
        A: eachTargetNum - eachCurrentNum.A,
        G: eachTargetNum - eachCurrentNum.G,
        C:eachTargetNum - eachCurrentNum.C,
        T:eachTargetNum - eachCurrentNum.T,
    }
    console.log('gene.length', gene.length);
    console.log('eachTargetNum', eachTargetNum);
    console.log('eachCurrentNum', eachCurrentNum);
    console.log('eachRequiredNum', eachRequiredNum);
    const removableGene = {}
    let requiredLen  = 0;

    for(const key of Object.keys(eachRequiredNum)){
        if(eachRequiredNum[key] < 0) {
            requiredLen += Math.abs(eachRequiredNum[key])
            removableGene[key] = {
                remainNum : eachRequiredNum[key],
                isSuccess : false ,
            }
        }
    }
    // console.log(removableGene);
    // console.log('requiredLen', requiredLen);
    let removableGeneArr = []
    let totalRemoveCount = 0
    for( const [targetGene, v] of Object.entries(removableGene)){
        // console.log();
        const geneCount = Math.abs(v.remainNum)
        console.log('removable geneName', targetGene);
        console.log('removable geneCount', geneCount);
        totalRemoveCount  += geneCount
       const geneIdxList = geneArr.map((value, idx, array)=> {
           if(value === targetGene) {
               return idx
           }
       })

       removableGeneArr = removableGeneArr.concat(geneIdxList)
    //    console.log(removableGeneArr);
    }
    console.log('totalRemoveCount', totalRemoveCount);
    removableGeneArr.sort((a,b) => a-b)
    // console.log(removableGeneArr);
    const undefinedIdx = removableGeneArr.indexOf(undefined)
    // console.log(undefinedIdx);
    const removableGeneArr2 = removableGeneArr.splice(0, undefinedIdx)
    console.log('removableGeneArr2', removableGeneArr2);
    let minGeneLen = 999999
    let minObj = {
        startIdx : -1,
        endIdx : -1,
    }

    for (let realIdx = 0; realIdx < removableGeneArr2.length; realIdx++) {
        // if(realIdx + totalRemoveCount - 1 >= removableGeneArr2.length ) {break}
        const geneStartIdx = removableGeneArr2[realIdx];
        const geneEndIdx = removableGeneArr2[realIdx + totalRemoveCount - 1]
        const geneLen = geneEndIdx - geneStartIdx + 1
        // console.log('geneStartIdx', geneStartIdx, 'geneEndIdx', geneEndIdx, 'geneLen', geneLen);
        if(geneLen < minGeneLen ) {
            minGeneLen = geneLen
            minObj.startIdx = geneStartIdx
            minObj.endIdx = geneEndIdx
        }
        // totalRemoveCount
    }
    // console.log({minGeneLen});
    console.log('minGeneLen', minGeneLen);
    console.log(minObj);
    if(minGeneLen === 999999 ) { return 0}
    else return minGeneLen
}










